import React from 'react';
import { styled } from 'styled-components';

const Container = styled.div`
  border: 1px solid red;
  margin-top: 100px;
  overflow: hidden;
`;

const Banner = styled.div`
  width: 100%;
`;

const Main = () => {
  return (
    <Container>
      <Banner>
        <img src='http://m.shop1.markgonzales.cafe24.com/images/MOBILE/M-main1.jpg'/>
        <img src='http://m.shop1.markgonzales.cafe24.com/images/MOBILE/M-main-2_---11.gif'/>
        <img src='https://scontent-ssn1-1.cdninstagram.com/v/t39.30808-6/358091551_1320178335247780_4637343665461838382_n.png?stp=dst-jpg&_nc_cat=104&ccb=1-7&_nc_sid=8ae9d6&_nc_ohc=tqmnG3xn8uEAX8lblo3&_nc_ht=scontent-ssn1-1.cdninstagram.com&edm=AM6HXa8EAAAA&oh=00_AfBONj9d6hxmKzJQ0UjbAg1oPF-fjRH_VXhX1E2Rs7CjMg&oe=64AC62C9'/>
      </Banner>
    </Container>
  )
}

export default Main;
